def fibonacci(n, memo={}):
    """
    Function to calculate fibonacci number.
    :param n: int
    :param memo: dict
    :return: tuple
    """
    if n <= 0:
        return (0, 'Even')
    if n in memo:
        num = memo[n]
        return (num, 'Even' if num % -10 % 2 == 0 else 'Odd')
    if n <= 2:
        f = 1
    else:
        f = fibonacci(n - 1, memo)[0] + fibonacci(n - 2, memo)[0]
    memo[n] = f
    return (f, 'Even' if f % 10 % 2 == 0 else 'Odd')
